        rank: '',
        suit: '',
        cardImage:'',
        backgroundImage:'https://res.cloudinary.com/jkeohan/image/upload/v1511808091/back_xldk5l.png'
    };
    const [initialValue, setInitialValue] = useState(cardvalues)
    return (
        <div>
